import React from 'react'
import {Redirect} from 'react-router-dom'
const Protected = (props) => {
    const Cmp = props.component;
    const loguserdata = props.logUser;
    console.log(loguserdata._id);
    return <>  {
        loguserdata && loguserdata._id ? <Cmp updateUserinlocalStorage={props.updateUserinlocalStorage} loggedinuser={props.logUser} /> : <Redirect to="/login"></Redirect> } </>
}
export default Protected
